    { name: "Linked Lists & Trees", desc: "Learn linked lists, binary trees, and tree traversals.", icon: <Cpu className="w-10 h-10 text-purple-600"/>, path: "/placement-prep/core-subjects/dsa/trees", color: "from-purple-100 to-purple-50" },
  ];

  return (
    <SubjectPage
      title="DSA Preparation"
      description="Build problem-solving skills with data structures and algorithms."
      topics={topics}
    />
  );
};

